            "R": 2,
            "Name": "Fragment of an Ancient Chord",
            "Desc": "Weapon Ascension Material.<br>A harp with rotten keys. Its voice blocked, it cannot be played nor its sound heard.<br>It is said the descendants of the forgotten music once lacquered mechanical wooden harps with gold in order to revive the magnificent remnants of the ancient dynasty, futilely attempting to match them to the silent golems...<br>A long time passed, and then more, and the rotten, off-key harps remained in the grasp of those silent giants, caressed by the waves, playing only sorrowful strains.",
