            "_id": 114037,
            "R": 2,
            "Name": "Copper Talisman of the Forest Dew",
            "Desc": "Weapon Ascension Material.<br>Under the instructions of the First Sage, the ancestors of the forest people made these talismans using withered trees to commemorate the Lord of Verdure.<br>The talisman's shape was inspired by the forest dew. It symbolizes the permeation of wisdom into mortal minds.",
